// src/components/CreateNewProject.js
import React from 'react';
import { useLocation } from 'react-router-dom';

const CreateNewProject = () => {
    const location = useLocation();
    const { language } = location.state || {}; // Access the passed language from state

    return (
        <div>
            <h2>Create New Project</h2>
            {language ? (
                <p>Selected Language for New Project: {language}</p> // Display the selected language
            ) : (
                <p>No language selected.</p>
            )}
            {/* Add your project creation logic here */}
        </div>
    );
};

export default CreateNewProject;
